# Obsidian Note Reviewer - Guia de Teste

## Sobre o Projeto

O **Obsidian Note Reviewer**  uma ferramenta web para revisar e anotar documentos markdown do Obsidian de forma colaborativa. Este projeto  um fork do Plannotator, adaptado especificamente para integrao com vaults Obsidian.

## Funcionalidades Principais

### 1. Editor de Frontmatter YAML
Voc pode editar o frontmatter YAML diretamente na interface:
- Clique no boto "Editar" que aparece ao passar o mouse sobre o bloco YAML
- Faa suas alteraes
- A validao em tempo real garante que o YAML esteja correto
- Salve ou cancele conforme necessrio

### 2. Sistema de Anotaes
Selecione qualquer texto neste documento para adicionar anotaes:
- **Comentrios**: Adicione observaes e sugestes
- **Highlights**: Marque trechos importantes
- **Feedback estruturado**: Organize suas revises de forma clara

### 3. Salvar no Vault
Configure o caminho do seu vault nas configuraes:
1. Clique no cone de configuraes (engrenagem)
2. Insira o **Caminho do Vault** (ex: \`C:/Users/Alex/Documents/ObsidianVault\`)
3. Insira o **Caminho da Nota** (ex: \`projetos/note-reviewer-teste.md\`)
4. Clique em "Salvar no Vault" para salvar esta nota editada

### 4. Modos de Visualizao
- **Modo Autor**: Para criar e editar contedo
- **Modo Revisor**: Para adicionar anotaes e feedback
- **Modo Visualizao**: Para ver anotaes compartilhadas

## Recursos Tcnicos

### Arquitetura
\`\`\`
obsidian-note-reviewer/
 apps/hook/          # Servidor local com API REST
 packages/
    editor/         # Componente principal App.tsx
    ui/             # Componentes React reutilizveis
 docs/               # Documentao
\`\`\`

### Stack Tecnolgica
- **Runtime**: Bun
- **Framework**: React + TypeScript
- **Build**: Vite com plugin singlefile
- **Parsing**: Remark/Unified para markdown
- **Validao YAML**: js-yaml
- **Testes**: Bun test + React Testing Library

### API Endpoints
O servidor local expe:
- \`POST /api/save\` - Salva nota no filesystem
- \`GET /api/share/:hash\` - Recupera nota compartilhada
- \`POST /api/share\` - Cria link de compartilhamento

## Melhorias Implementadas (v0.1  v0.2.1)

### Da Upstream (Plannotator)
1.  Verificao automtica de atualizaes
2.  Exibio dinmica da verso
3.  Correo de URLs de compartilhamento
4.  Melhorias na restaurao de anotaes

### Customizaes para Obsidian
1.  **Traduo completa para portugus brasileiro**
2.  **Boto "Salvar no Vault"** com feedback visual
3.  **Configurao de caminhos** persistente via cookies
4.  **Editor de frontmatter YAML** com validao
5.  **Documentao de integrao MCP** para Claude Code
6.  **Suite de testes automatizados** com cobertura >80%

## Como Testar Esta Nota

### Passo 1: Carregar a Nota
1. Abra o Obsidian Note Reviewer no navegador
2. Esta nota deve carregar automaticamente
3. Verifique se o frontmatter YAML est sendo exibido corretamente

### Passo 2: Testar Edio de Frontmatter
1. Passe o mouse sobre o bloco YAML no topo
2. Clique em "Editar"
3. Altere o valor de \`status\` para \`in-review\`
4. Salve e veja a mudana refletida

### Passo 3: Adicionar Anotaes
1. Selecione este texto: **"Este  um texto importante para reviso"**
2. Adicione um comentrio: "Concordo, muito relevante!"
3. Veja a anotao aparecer na barra lateral

### Passo 4: Salvar no Vault
1. Abra as configuraes (cone de engrenagem)
2. Configure:
   - Caminho do Vault: seu diretrio Obsidian
   - Caminho da Nota: \`testes/note-reviewer-exemplo.md\`
3. Clique em "Salvar no Vault"
4. Abra o Obsidian e verifique se a nota foi criada

## Casos de Uso

### Para Autores
- Escreva notas markdown com frontmatter rico
- Receba feedback estruturado de revisores
- Mantenha histrico de revises

### Para Revisores
- Adicione anotaes contextuais
- Sugira melhorias diretamente no texto
- Aprove ou solicite alteraes

### Para Equipes
- Compartilhe notas via URL
- Colabore de forma assncrona
- Integre com workflows existentes do Obsidian

## Atalhos e Dicas

| Ao | Como Fazer |
|------|------------|
| Adicionar anotao | Selecione texto + clique no popup |
| Editar frontmatter | Hover sobre YAML + "Editar" |
| Salvar no vault | Boto "Salvar no Vault" (aps configurar) |
| Ver anotaes | Painel lateral direito |
| Mudar modo | Toggle Autor/Revisor no header |

## Prximos Passos

Aps testar esta nota, voc pode:
1. **Criar suas prprias notas** markdown com frontmatter customizado
2. **Integrar com seu vault** usando os caminhos configurados
3. **Compartilhar com revisores** gerando links de compartilhamento
4. **Explorar a integrao MCP** (veja \`docs/OBSIDIAN_INTEGRATION.md\`)

## Suporte e Documentao

- **Repositrio**: \`C:/dev/obsidian-note-reviewer\`
- **Docs**: \`docs/OBSIDIAN_INTEGRATION.md\`
- **Testes**: Execute \`bun test\` para ver cobertura
